import * as React from "react";
import { StyleSheet, TouchableOpacity, Text } from "react-native";
import { Avatar, Button, Card, Title, Paragraph } from "react-native-paper";
import Https from "./Https";

const LeftContent = (props) => <Avatar.Icon {...props} icon="folder" />;
const onPressingCard=(pokemon,navigation)=>{
  Https({navigation},pokemon)

}

const MyComponent = ({item,navigation}) => (

  <TouchableOpacity onPress={()=>{
    onPressingCard(item.data.pokemon,item)
  }}>
    {console.log(item)}

    <Card style={styles.Card}>
      <Card.Cover
        style={styles.imageStyle}
        source={{ uri: item.data.imageSrc }}
      />
      <Card.Content style={styles.cover}><Text>{item.data.pokemon}</Text></Card.Content>
    </Card>
   </TouchableOpacity>
);

export default MyComponent;
const styles = StyleSheet.create({
  imageStyle: {
    width: 300,
    height: 300,
    backgroundColor: "skyblue",
  },
  CardType: {
    flex: 1,
    alignContent: "space-between",
  },
  Card: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    padding: 80,
  },
  cover: {
    alignItems: "center",
    justifyContent: "center",
    alignContent: "center",
    fontWeight: "bold",
  },
});
